INSERT INTO MT_QUESTIONAIR VALUES (27972, 'M', 41, 'ประถมศึกษา', 'เป็นผู้พิการ', 'ขอข้อมูล / คำปรึกษา', 5, 3, 5, 5, 5, 5, 4, 0, 5, 5, 5, 3, 2, 'อยากให้ออกหน่วยงานสัญจรสู่ชุมชนให้มากกว่าเดิมและข่าวสารข้อมูลส่งตรงถึงชมรมผู้พิการทุก ๆ ทิ้งที่และอย่างต่อเนื่อง', 304, 2553, 2, 1265043600, 2, NULL, 21, NULL);
